glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
#if USE_TEXTURE
in vec2 a_uv0;
in vec2 a_uv1;
out vec2 v_uv0;
out vec2 v_uv1;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  v_uv0 = a_uv0;
  v_uv1 = a_uv1;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
#if USE_TEXTURE
in vec2 v_uv0;
in vec2 v_uv1;
uniform sampler2D texture;
#endif
void main () {
  vec4 o = texture(texture, v_uv0);
  float grey = 0.2126*o.r + 0.7152*o.g + 0.0722*o.b;
  vec4 greyColor = vec4(grey, grey, grey, o.a);
  vec4 oriColor = o*v_uv1.x;
  greyColor = greyColor*v_uv1.y;
  gl_FragColor = oriColor + greyColor;
}

